  _id,
  True as isAnonymous,
  _script.ip2int(user) ip_integer
from sandbox."wikimedia-recentchange" 
WHERE _event_time > CURRENT_TIMESTAMP() - minutes(10)
AND REGEXP_LIKE(user, '\d+\.\d+\.\d+\.\d+')

script {{{
  export function create_seed_array(input_array){
    const alpha = Array.from(Array(26)).map((e, i) => i + 65);
    const alphabet = alpha.map((x) => String.fromCharCode(x).toLowerCase());

    var array1=alphabet;
    var array2=alphabet;

    var alpha_array = array1.flatMap(d => array2.map(v => d + v))
    var out_array = alphabet.concat(alpha_array)

    var term_map = {};
    for (const i in out_array) {
      term_map[out_array[i]] = 0
    }

    for (const r in input_array) {
      var cur_val = term_map[input_array[r]]
      cur_val = cur_val + 1
      term_map[input_array[r]] = cur_val
    }

    const ordered = Object.keys(term_map).sort()

    var vector = [];

    var index = 0
    for (const v in ordered){
          vector[index] = term_map[ordered[v]]
          index = index + 1
    }

    return vector
  }
}}}
select f."Child's First Name", * EXCEPT(name_embedding),
DOT_PRODUCT(name_embedding, VECTOR_ENFORCE(_script.create_seed_array(ARRAY_CONCAT(ngrams(REGEXP_REPLACE(LOWER(:name), '''|\s'), 1), ngrams(REGEXP_REPLACE(LOWER(:name), '''|\s'), 2))), 702, 'int')) as vs_score
from sandbox.first_names_2_gram_embedding_v3 f -- hint(access_path = index_similarity_search)
where "Year of Birth" = '2012'
and Ethnicity = 'WHITE NON HISP'
order by vs_score desc;

script{{{

var TABLE = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/';
var REGEX_SPACE_CHARACTERS = /<%= spaceCharacters %>/g;

export function base64_decode(input) {

		input = String(input)
			.replace(REGEX_SPACE_CHARACTERS, '');
		var length = input.length;
		if (length % 4 == 0) {
			input = input.replace(/==?$/, '');
			length = input.length;
		}
		if (
			length % 4 == 1 ||
			// http://whatwg.org/C#alphanumeric-ascii-characters
			/[^+a-zA-Z0-9/]/.test(input)
		) {
			error(
				'Invalid character: the string to be decoded is not correctly encoded.'
			);
		}
		var bitCounter = 0;
		var bitStorage;
		var buffer;
		var output = '';
		var position = -1;
		while (++position < length) {
			buffer = TABLE.indexOf(input.charAt(position));
			bitStorage = bitCounter % 4 ? bitStorage * 64 + buffer : buffer;
			// Unless this is the first of a group of 4 characters…
			if (bitCounter++ % 4) {
				// …convert the first 8 bits to a single ASCII character.
				output += String.fromCharCode(
					0xFF & bitStorage >> (-2 * bitCounter & 6)
				);
			}
		}
		return output;

}


export function _base64ToArrayBuffer(base64_bytes) {
    var binary_string = base64_decode(base64_bytes);

    var len = binary_string.length;

    var bytes = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
        bytes[i] = binary_string.charCodeAt(i);
    }
    return bytes;

}


}}}

