script{{{
export function getcord(lat, long, r, n) {
  var arr = new Array();
  var steps = 360 / parseInt(n);
  for (var i = 0; i<parseInt(n); i++) {
    var deg = i*steps
    var x = r*Math.cos(deg*(Math.PI/180))+lat
    var y = r*Math.sin(deg*(Math.PI/180))+long
    var c = x + ' ' +y 
    arr.push(c)
  }
  return `POLYGON((${arr}))`;
}
}}}

