script {{{
export function levenshtein_generate(x, fuzziness, prefix, positions) {
    const result = new Array();
    const initial_string = x.toLowerCase();
    let replacements = 0;
    if (typeof fuzziness == 'string') {
        switch (true) {
            case (x.length <= 2):
                replacements = 0;
                break;
            case (x.length <= 5):
                replacements = 1;
                break;
            case (x.length > 5):
                replacements = 2;
                break;
        }
    } else {
        replacements = fuzziness;
    }
    var _prefix = initial_string.substring(0, prefix);
    var _suffix = initial_string.substring(prefix);
    var transposed_strings = transpose_character(_prefix, _suffix, positions);
    var removed_strings = remove_character(_prefix, _suffix, positions);
    var added_strings = add_character(_prefix, _suffix);
    var changed_strings = change_character(_prefix, _suffix);
    result.push(transposed_strings);
    result.push(removed_strings);
    result.push(added_strings);
    result.push(changed_strings);
    let flatArray = flatten(result);
    return flatArray;
}

export function transpose_character(prefix, suffix, positions) {
    let result = new Set();
    const substrings = Array.from(suffix);
    substrings.forEach(function(letter, idx) {
        var _post_string = Array.from(substrings);
        let _pre_string = _post_string.splice(idx, positions);
        let letters = _pre_string.join('');
        _post_string.forEach(function(x, _index) {
            let _inner_string = Array.from(_post_string);
            _inner_string.splice(_index, 0, letters);
            var intirum_result = _inner_string.join('');
            result.add(prefix + intirum_result);
        })
    })
    return result;
}

export function remove_character(prefix, suffix, positions) {
    let substrings = new Array();
    let result = new Set();
    substrings = Array.from(suffix);
    substrings.forEach(function(letter, idx) {
        var _post_string = Array.from(substrings);
        let _pre_string = _post_string.splice(idx);
        var intirim_result = Array.from(_post_string);
        intirim_result = intirim_result.slice(0, -1).join('') + _pre_string.join('');
        result.add(intirim_result);
    })
    return result;

}

export function change_character(prefix, suffix) {
    let result = new Set();
    const alpha = Array.from(Array(26)).map((e, i) => i + 97);
    const alphabet = alpha.map((x) => String.fromCharCode(x)).flat();
    const substrings = Array.from(suffix);
    substrings.forEach(function(letter, idx) {
        if (idx == 0) {} else {
            var _post_string = Array.from(substrings);
            let _pre_string = _post_string.splice(idx);
            var intirim_result = Array.from(_post_string);
            intirim_result = intirim_result.slice(0, -1);
            alphabet.forEach(function(letter) {

                result.add(intirim_result.join('') + letter + _pre_string.join(''));
            })

        }
    })
    return result;
}

export function add_character(prefix, suffix) {
    let result = new Set();
    const alpha = Array.from(Array(26)).map((e, i) => i + 97);
    const alphabet = alpha.map((x) => String.fromCharCode(x)).flat();
    const substrings = Array.from(suffix).concat(['']);
    substrings.forEach(function(letter, idx) {

        var _post_string = Array.from(substrings);
        let _pre_string = _post_string.splice(idx);
        var intirim_result = Array.from(_post_string);
        // intirim_result = intirim_result.slice(0, -1);
        alphabet.forEach(function(letter) {
            result.add(intirim_result.join('') + letter + _pre_string.join(''));
        })
    })
    return result;
}

export function flatten(arr) {
    let final_array = new Array();
    for (var x = 0; x < arr.length; x++) {
            arr[x].forEach(key => {
                final_array.push(key);
            })

    }
    return final_array;
}

}}}

